        .aligner{
            display: flex;
            justify-content: center;
            align-items: center;
            height: 800px;
        }

        .btn-aligner{
            display: flex;
            justify-content: center;
        }

        .aligner .container {
            display: flex;
            flex-direction: column;
        }
        
        .text-bold {
            font-weight: bold;
        }
        
        .text-style {
            font-family: Assistant, sans-serif;
            color: rgb(255, 255, 255);
            font-size: 20px;
            text-align: right;
            background-color: #00000040;
            padding: 0 18px 22px;
            border-radius: 10px;
            
        }
        
        p,
        a {
            direction: rtl;
        }
        
        .ellipse-container-btn {
            background-color: #90c553;
            color: white;
            text-decoration: none;
            border-radius: 50px;
            text-align: center;
            font-size: 0.8em;
            padding: 1rem;
            width: 460px;
        }
        
        .shadow-btn {
            box-shadow: 2px 2px 10px #888888;
        }
        
        a:hover {
            background-color: #749e44;
        }
